import React from 'react'
import Header from './Header/Header'
import ob from './Info.module.css'

const Info = () => {
  return (
    <div className={ob.content__info}>
      <Header />

      <section className={ob.content__body}>
        
      </section>

    </div>
  )
}

export default Info;
